(748, 19221, '2', 'What are your professional experiences that may be relevant to this course?', '1. I am a technical lead for my team, i have to motivate team to innovate, i have to influence to get a buy-in, i have to negotiate with project managers. Since i talk very straight forward sometimes the relationship gets strained. So want to build my communication style where everyone who listen to me likes the way i talk or argue and i should build a lot of follower because of my successful delivery of presentations, seminars, etc.\r\n2. Since i am a technical lead, there is a need for continuous innovation. To innovate i need to have good knowledge or expertise and i should be aware of what new in the industry. There are lot of change happening in the industry, i will have to build my knowledge is all those fields which has direct or indirect relation with my area of work/expertise. With available time its tough to gain knowledge on all. So want to enable the capacity of my brain to learn things real fast so that i build my skills in just one read and able to recall it whenever required', '2014-02-20 10:27:25', '2014-02-28 08:02:06', 65, 1),
