(753, 19221, '2', 'When you finish the course, how will you use NLP?', '1. I will use NLP techniques to build my technical skills faster. Attempt to learn a new technology every week\r\n2. i will apply NLP techniques to build my intuition and also great depth understanding of astrological concept\r\n3. i will use NLP techniques to build my financial stability\r\n4. I will use NLP techniques to become a successful communicator and crowd puller.\r\n5. I will use NLP techniques to build my relationship with my family and relatives.\r\n6. i will use NLP techniques to because a positive thinker\r\n7. i will use NLP techniques to be a respectable leader both technically and also personal.', '2014-02-20 10:27:25', '2014-02-28 08:02:06', 65, NULL),
