(756, 19221, '1', 'What personal transformations do you seek from the course?', '1. I grasp things fast when i am trained, but my speed is bad if i try to gain the knowledge through book or experience. So i want to see a transformation here, i learn a new computer languge within 4 days when i am trained, while i take a lot of time if i try learning by reading books. I want grasping power while reading books to be same as when i get trained. (2). I concious control my emotions, but on road its worst and sometimes this control also makes me uncomfortable. So want to overcome such uncomfortable feelings and also control anger on road. (3) I make lot of plans, but fail to follow the plan, so after the course i want to be a perfect plan follower. (3) Since 9 years of experience i have one skill always on improvement section and that is communication, after this course i want to be a great communicator and everyone appreaciates my way of communication. (4) Innovation is something which is not very powerful in me, i want to do lot of innovations to gain better results and also personal satisfaction. ', '2014-02-20 10:27:25', '2014-02-28 08:02:06', 65, 1),
(757, 19221, '1', 'Tell us more about your dreams & goals', 'I have 3 major goals in life, 1) Billionare, 2) Successful Astrologer, and 3) Technical Master. I grew up in poor family and now we are in a better shape, but still many times when we want to purchase we have to think a lot before deciding, so want to be a billionare so that i dont need to think twice before purchasing something that makes someone happy. Astrology is a super science and also very complex, because of its complexity lot of astrology predictions fail, i want to build my expertise in astrology so that i can blend all the complexities and gives a very accurate predictions, this way i will be able to help the society. Lastly i like being technical person, i like to be involved on the latest technologies being a master technologist means i will be very much respected by lot of people.', '2014-02-20 10:27:25', '2014-02-28 08:02:06', 65, 1),
