(815, 19638, '2', 'What are your expectations from the course?', 'There have been instances in personal and professional life, where it becomes really hard to:\r\n\r\n1. Bring about a positive change in others (while also ensuring that the recipient also considers the respective change ''equally or more positive''. \r\n2. Handle situations wherein  your vulnerability makes other people (family, partners, friends, seniors etc.) ''emotionally blackmail'' you and later you realize that you could have tried to overcome that fear of others approaching you with their unjustified demands and cutting corners from you.\r\n3. Jump into your passions and take major decisions, by putting everything else at risk. \r\n4. Figure out the quantifiable ROI of the professional stuff you do.\r\n5. Reach at ''clarity'' of what you want to do at the given moment and in a given situation, with your life [personal and professional]\r\n\r\nand so much more. I expect to learn more on handling above situations with ease and confident, love my life even more after that, be able to make the desired changes in my life and others'' life. I also expect to derive some learnings BEYOND the above stated points, I wish to come with an open mindset and explore NLP in an interesting and not too boring manner as somewhere I realize that I''m more of a ''Feeler'' & ''Kinesthetic'' person & too much of number and data based stuff only keeps me away from it! :)\r\n\r\nOn a very specific note however, I''ve 2-3 key objectives that i want to meet, besides the above given points. I''m looking for specific ''interventions'' and help from you to help me convince my life partner (with whom I want to get married to) on certain critical things, along with convincing my parents too on few important parameters. Other than that, I wish to gain help in figuring out how to follow my passions.', '2014-03-10 08:03:16', '2014-03-10 08:03:16', 65, 1),
