(820, 19638, '1', 'Any other comments you wish to make or anything more you would like to tell us about you:', 'I''m at a juncture of life, where i get emotionally exhausted too soon, due to financial pressure, health problems, parental pressure on certain things, not getting any results on some key issues despite investing so much of efforts. Need to know how to see if our approach towards some situation is wrong and then how to rectify it. I''d been a very strong and positive person throughout, but due to constant struggles since childhood, i now feel drained out and having reached a saturation point. This was one of the key factors that drove me to go for NLP, some instinct told me to go for it. That''s it!', '2014-03-10 08:03:16', '2014-03-10 08:03:16', 65, NULL),
