(861, 19612, '2', 'What are your expectations from the course?', '* I want to experience the change of possibilities. How will this program help me change my overall personality?\r\n\r\n* I want to learn how to disconnect from your past experience and lead a learned life henceforth.\r\n\r\n* I want to learn the techniques on how to speak with leaders even if you have the least idea on the topic of discussion.\r\n\r\n* To be able to say No when I actually want to say no.\r\n\r\n* I want to learn the healing techniques.\r\n\r\n* How I can apply NLP techniques to whomsoever I communicate whether in India or Overseas\r\n\r\n* What are the various techniques you would use to evaluate present being of the learner so that I know exactly what changes I can expect from this program?\r\n\r\n* Does this program ensure that it is effective throughout learners professional and personal life?\r\n\r\n* I am moving to Australia, will I get assistance there as well. Do I have the opportunity to meet your professional trainers there without any extra cost?\r\n\r\n* How do you ensure your learner has understood the techniques and will apply post NLP session?\r\n\r\nP.S While I understand most trainers will always say, with practice everything is possible. Apply the techniques and feel the change. I love to hear from a trainer who will ensure the change is apparent to the learner. The learning should be fun and stress free.', '2014-04-20 04:20:37', '2014-04-20 04:20:37', 65, 1),
