(996, 19419, '2', 'What are your expectations from the course?', '1) Always, I tend to loose the focus on whatever task I take in hand. I keep on hopping from one task to another and because of which I am not able to achieve my daily goals. I want have clarity of thoughts so that I know why,how & when should I do task, smartly, will help me to achieve the my daily goals.\r\n\r\n2) I am an extrovert person, but from the past few months I am unable to communicate well with people. And I tend to keep myself restricted and because of which I feel suffocated. Because I have failed on several occasions in the past 2 years, people have started taking me for granted. I have started feeling that my character is being "assassinated". I want to regain that confidence and want to be an effective communicator, so that I influence people, obviously in good ways, and achieve my goals.\r\n\r\n3) I am finding it really difficult to balance my personal & professional life. And the main reason for that is my current financial situation. I had lost my job almost a year back and I had no money left with me. I was running here and there to earn money, and that continued even after I got the job. And the reason why kept on going was because of the big vacuum that was created because on no money.\r\n\r\n4) I want to quit smoking completely.\r\n\r\n5) I have started my own company and from the last 3 years I am not able to generate any new business. I want to have clear understanding in terms of my strengths & weaknesses that will help me to grow my company.\r\n\r\n6) I want to clear my debts. I know that just by doing NLP training that is not going to happen. I am expecting that this training will help me to regain my focus, strength and will give me a clear direction so that I know how I can clear my debts. I want to clear 50% of my debts in the next 3 months and the balance 50% in the next 3 months, after that.\r\n', '2014-04-29 07:19:00', '2014-04-29 07:19:00', 65, 1),
