(1001, 19419, '1', 'Any other comments you wish to make or anything more you would like to tell us about you:', 'I have been bad guy in my family and the reason for that is because I have always failed on my commitments, may it be any financial commitment, or may it be routine house hold task such as going to bank, going for grocery shopping. I am unable to fulfill those commitment most of the time. Due these failures, my family members have started loosing trust in me. Fortunately, I have not indulge myself in any illegal activities for generating money, inspite of the bad situation. I want see a change in myself so that I can be a good son, brother, husband and a father.', '2014-04-29 07:19:00', '2014-04-29 07:19:00', 65, NULL),
(1002, 19419, '2', 'In which areas of your Life are you most motivated to use NLP?', 'The reason why I am interested in NLP is because:\r\n\r\n1) I want have a more focused approach in my professional career so that I can grow my own company and generate more money :)\r\n2) As mentioned earlier, I want to have proper balance in my life.\r\n3) Influencing people is the key to success. I want influence people so that they starting taking the right decision, which in turn will help me to make money :). I am specifically looking to influence people to take the services which I am offering i.e. Online Marketing Services.\r\n4) In order to succeed in life everybody has to improve the skills on an ongoing basis. I want to identify those opportunities and help myself to enhance my skills.\r\n', '2014-04-29 07:19:00', '2014-04-29 07:19:00', 65, 1),
(1003, 19419, '2', 'When you finish the course, how will you use NLP?', 'I would be using NLP in my presentations, in my communications (i.e. emails, talking over the phone and face to face communications). I will be using it in growing my business i.e. catering online marketing coaching & services.', '2014-04-29 07:19:00', '2014-04-29 07:19:00', 65, NULL),
(1004, 19419, '1', 'What do you do?', 'I am an online marketing specialist, and I look after the paid search. My responsibilities are to look into day to day paid search activities such as bring targeted traffic, bid optimization and many more.', '2014-04-29 07:19:00', '2014-04-29 07:19:00', 65, 1),
(1005, 19419, '2', 'If just ''ONE'' aspect of your Life can change everything for you - what is it? ', 'As mentioned earlier, I want to be an entrepreneur. Nobody can become a successful entrepreneur overnight. In order to see a success, one needs to build the business and to build the business one needs to be an effective communicator. \r\n\r\nI want to see myself as an effective communicator, may it be writing a sales copy, or perhaps writing an email, or perhaps doing a sales pitch presentation, or talking to anybody. I should be creating the powerful impact that will subtly force them to take action.', '2014-04-29 07:19:00', '2014-04-29 07:19:00', 65, 1),
(1006, 19419, '1', 'What personal transformations do you seek from the course?', 'I want to be more confident in whatever I do. I want to have a focused approach, which is currently missing. And more over whenever I talk to people they should feel that they have gained something by meeting me. ', '2014-04-29 07:19:00', '2014-04-29 07:19:00', 65, 1),
(1007, 19419, '1', 'Tell us more about your dreams & goals', 'I am a materialistic man. I want to have enough money that will help me to give luxurious to my family and me. My goal is to retire in the next 6 years and spend rest of the life doing social work, and coach people to do the same.', '2014-04-29 07:19:00', '2014-04-29 07:19:00', 65, 1),
