(1042, 19424, '2', 'What are your expectations from the course?', 'I have always been very interested as to how the mind works. Why does it work the way it does for some and doesn''t for someone else. In fact It is very interesting the way I got to know about NLP. One fine morning I got up with this thought as to what happens when a person gets drunk? why does he behave the way he does? what goes on in the head at that point in time. That very morning I opened my mac and started searching for medical answers . While researching I was led to the NLP site and thus began my quest to know more about NLP. Before this I was unaware of the NLP . I was actually very excited and then spoke to my wife who is a medical doctor and she also confirmed that NLP is used by docs too. I further chatted up with few on Linked in about NLP and of course researched a lot to find the right people to train me. \r\n\r\nI have been very passionate about executive coaching . I have thus taken my Life''s most bold step of resigning from a comfortable corporate job with a predictive salary  and taken on the path of business consulting. This program will most certainly help me is what I feel in my current journey. I expect that I would know primarily how my mind works and its bottlenecks, i am also expecting that by doing this with you and other participants it would give me lot of know-how at the experiential level. With loads of research I have decided on SOE and I am sure I will certainly come out of the training as a better person on mind matters and hopefully would contribute to the society. ', '2014-05-01 17:54:01', '2014-05-01 17:54:01', 65, 1),
