(1177, 19434, '2', 'What are your expectations from the course?', 'Thanks Team. Honour your concern and looking forward deep from my heart if there is some one who can pull me up in my life.i am 32 now and till this minute in life, whatever i have got for myself was not by my liking or interest or passion. Everything was on mere survival basis, compulsion, by force or family situation. My job, education, married life all are like that only.  \r\nI am looking for a better career change. I am learning Yoga. I want to to learn NLP which will help me in learn Yoga better which again deals with our Mind. \r\nI am currently doing a Network Marketing Business. Though i am much confident that i can help people''s lives to get elevated if they join me, i am not able to market my business properly. hence i have not started earning from that. I love my networking business more than my bank job. i love business training. My banking career is not as i had expected. i am just earning. thats it. There is no life. i am one amongst a group of 100.\r\nI have a feel that my stress levels are too high. I did not have the mind to eat good and healthy food in the mornings and during office hours  for the past 9 years. frankly speaking, i hate what i did. had to work to survive and meet family expectations. everything to me is "i had to" and not "i liked to". Now everything has resulted in "unfit health condition" to produce a child. \r\n\r\nMy expectations are, i have to have a hale and healthy body and mind. to give birth to a healthy child, need to be financial strong. Should "live" and not "survive" should create an enormous change in the society with the help of my networking business as it touches the lives of people who ever comes to it. enhance relationship in my family as currently it is pathetic. Money is the main reason. i want to give a happier life to my Parents and my Wife. i want to be a Successful NLP practitioner and if eligible an eminent "NLP trainer". \r\n\r\n2 other expectations which may be silly but i am much concerned about them. i want to sell of my land that i had purchased by a so called friend who had tricked me to buy the same. was interested in a business (deals human empowerment  / child empowerment programs, child brain development concepts and energy healing) and invested 3 lakhs of rupees. have no result from it. my money is now stuck and my friend is not helping to take back the same. need to find a solution or a way to sell my land and get back the investment from the business atleast with bank interest for 3 years. ', '2014-05-19 06:17:06', '2014-05-19 06:17:06', 65, 1),
